PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE telemetry_record (
	id INTEGER NOT NULL, 
	device_id VARCHAR(64) NOT NULL, 
	voltage FLOAT, 
	current FLOAT, 
	temperature FLOAT, 
	ts DATETIME NOT NULL, 
	PRIMARY KEY (id)
);
CREATE TABLE device (
	id INTEGER NOT NULL, 
	device_id VARCHAR(64) NOT NULL, 
	status VARCHAR(8) NOT NULL, 
	last_seen DATETIME NOT NULL, 
	PRIMARY KEY (id)
);
CREATE INDEX ix_telemetry_record_device_id ON telemetry_record (device_id);
CREATE UNIQUE INDEX ix_device_device_id ON device (device_id);
COMMIT;
